<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>SQLite</b> est un moteur de base de données écrit en langage de programmation C. Ce n'est pas une application autonome; il s'agit plutôt d'une bibliothèque que les développeurs de logiciels intègrent dans leurs applications. A ce titre, elle appartient à la famille des bases de données embarquées. Il s'agit du moteur de base de données le plus largement déployé, car il est utilisé par plusieurs des principaux navigateurs Web&nbsp; systèmes d'exploitation, téléphones mobiles et autres systèmes embarqués. De nombreux langages de programmation ont des liaisons avec la bibliothèque SQLite. Il suit généralement la syntaxe PostgreSQL , mais n'applique pas la vérification de type par défaut. Cela signifie que l'on peut, par exemple, insérer une chaîne dans une colonne définie comme un entier.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
