<h1 class="Section4">
<a class="Section5" href="#" id="installation-de-sqlite-v3-sous-ubuntu">Installation de SQLite v3 sous Ubuntu</a>
</h1>
<div class="Section6"><br>Nous essayerons d'installer SQLite dans notre environnement de développement. Ouvrir un terminal. Installer SQLite.<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">sudo apt-get install sqlite3</pre><br></div>
</div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="base-de-donnees">Base de données</a>
</h1>
<div class="Section6"><br>Une <b>base de données</b> permet de stocker et de retrouver des données structurées, semi-structurées ou des données brutes ou de l'information, souvent en rapport avec un thème ou une activité; celles-ci peuvent être de natures différentes et plus ou moins reliées entre elles.

Leurs données peuvent être stockées sous une forme très structurée (base de données relationnelles par exemple), ou bien sous la forme de données brutes peu structurées (avec les bases de données NoSQL par exemple). Une base de données peut être localisée dans un même lieu et sur un même support informatisé, ou répartie sur plusieurs machines à plusieurs endroits.

La base de données est au centre des dispositifs informatiques de collecte, mise en forme, stockage et utilisation d'informations. Le dispositif comporte un système de gestion de base de données (abréviation : SGBD) : un logiciel moteur qui manipule la base de données et dirige l'accès à son contenu. De tels dispositifs comportent également des logiciels applicatifs, et un ensemble de règles relatives à l'accès et l'utilisation des informations.

La manipulation de données est une des utilisations les plus courantes des ordinateurs. Les bases de données sont par exemple utilisées dans les secteurs de la finance, des assurances, des écoles, de l'épidémiologie, de l'administration publique (notamment les statistiques) et des médias.

Lorsque plusieurs objets nommés « bases de données » sont constitués sous forme de collection, on parle alors d'une banque de données.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#base-de-donnees_ouverture-de-la-base-de-donnees">Ouverture de la base de données</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#base-de-donnees_affichage-de-la-base-de-donnees-courante">Affichage de la base de données courante</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="base-de-donnees_ouverture-de-la-base-de-donnees" href="#base-de-donnees">Ouverture de la base de données</a>
</h2>&nbsp;<br>Nous essayerons d'ouvrir la base de données (database.sql) à partir du répertoire racine (/home/admin/dev/sqlite). Ouvrir un terminal. Se déplacer dans le répertoire racine. Ouvrir la base de données.<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">cd /home/admin/dev/sqlite
sqlite3 database.dat</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="base-de-donnees_affichage-de-la-base-de-donnees-courante" href="#base-de-donnees">Affichage de la base de données courante</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">.databases</pre><br></div>
</div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="table">Table</a>
</h1>
<div class="Section6"><br>Dans les bases de données relationnelles, une <b>table</b> est un ensemble de données organisées sous forme d'un tableau où les colonnes correspondent à des catégories d'information (une colonne peut stocker des numéros de téléphone, une autre des noms, etc.) et les lignes à des enregistrements, également appelés entrées.

Chaque table est l'implémentation physique d'une relation entre les différentes colonnes. Chaque correspondance est définie par une ligne de la table.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#table_creation-d-une-table">Création d'une table</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#table_affichage-des-tables">Affichage des tables</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#table_affichage-du-schema-de-table">Affichage du schéma de table</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#table_suppression-d-une-table">Suppression d'une table</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="table_creation-d-une-table" href="#table">Création d'une table</a>
</h2><br>Nous essayerons de créer la table (views).<br><br><pre class="GCode1 Code1 AceCode" data-mode="sql" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">create table _views (
    _id integer primary key autoincrement
    , _url varchar(255) not null
    , _view integer not null
    , _create_date datetime default current_timestamp
    , _upadte_date datetime
    , unique(_url)
);</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="table_affichage-des-tables" href="#table">Affichage des tables</a>
</h2><br>Nous essayerons d'afficher l'ensemble des tables de la base de données.&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">.tables</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="table_affichage-du-schema-de-table" href="#table">Affichage du schéma de table</a>
</h2><br>Nous essayerons d'afficher le schéma de la table (views).<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">.schema views</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="table_suppression-d-une-table" href="#table">Suppression d'une table</a>
</h2><br>Nous essayerons de supprimer la table (views).<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">drop table views;</pre><br></div></div></div></div><br>